// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../interfaces/IMyUniswapV2Pair.sol";
import "../libraries/Math.sol";

/**
 * @title MyUniswapV2Pair
 * @dev 实现Uniswap V2的交易对合约，管理两个ERC20代币之间的流动性和交易
 */
contract MyUniswapV2Pair is IMyUniswapV2Pair, ERC20 {
    // 重入保护状态变量
    uint256 private constant _NOT_ENTERED = 1;
    uint256 private constant _ENTERED = 2;
    uint256 private _status;

    // 单重入锁
    uint private unlocked = 1;
    
    // 工厂合约地址
    address public override factory;
    // 交易对中的两个代币地址
    address public override token0;
    address public override token1;
    
    // 储备量变量
    uint112 private reserve0;
    uint112 private reserve1;
    uint32  private blockTimestampLast;
    
    // 价格累加器
    uint public override price0CumulativeLast;
    uint public override price1CumulativeLast;
    uint public override kLast;
    
    uint private constant _MINIMUM_LIQUIDITY = 1000;
    
    // 使用 Math 库
    using Math for uint;

    
    modifier nonReentrant() {
        require(_status != _ENTERED, "ReentrancyGuard: reentrant call");
        _status = _ENTERED;
        _;
        _status = _NOT_ENTERED;
    }
    
    modifier lock() {
        require(unlocked == 1, 'UniswapV2: LOCKED');
        unlocked = 0;
        _;
        unlocked = 1;
    }
    
    constructor() ERC20("Uniswap V2", "UNI-V2") {
        factory = msg.sender;
        _status = _NOT_ENTERED;
    }
    
    function initialize(address _token0, address _token1) external override {
        require(msg.sender == factory, 'UniswapV2: FORBIDDEN');
        token0 = _token0;
        token1 = _token1;
    }
    
    /**
     * @dev 获取当前储备量和最后更新时间
     * @return _reserve0 token0的储备量
     * @return _reserve1 token1的储备量
     * @return _blockTimestampLast 最后更新时间
     */
    function getReserves() public view returns (
        uint112 _reserve0, 
        uint112 _reserve1, 
        uint32 _blockTimestampLast
    ) {
        _reserve0 = reserve0;
        _reserve1 = reserve1;
        _blockTimestampLast = blockTimestampLast;
    }
    
    function mint(address to) external override lock nonReentrant returns (uint liquidity) {
        (uint112 _reserve0, uint112 _reserve1,) = getReserves();
        uint balance0 = IERC20(token0).balanceOf(address(this));
        uint balance1 = IERC20(token1).balanceOf(address(this));
        uint amount0 = balance0 - _reserve0;
        uint amount1 = balance1 - _reserve1;
        
        if (totalSupply() == 0) {
            liquidity = Math.sqrt(amount0 * amount1) - _MINIMUM_LIQUIDITY;
            _mint(address(0), _MINIMUM_LIQUIDITY);
        } else {
            liquidity = Math.min(
                (amount0 * totalSupply()) / _reserve0,
                (amount1 * totalSupply()) / _reserve1
            );
        }
        
        require(liquidity > 0, 'UniswapV2: INSUFFICIENT_LIQUIDITY_MINTED');
        _mint(to, liquidity);
        
        _update(balance0, balance1);
        kLast = uint(reserve0) * uint(reserve1);
        
        emit Mint(msg.sender, amount0, amount1);
    }
    
    function burn(address to) external override lock nonReentrant returns (uint amount0, uint amount1) {
        uint balance0 = IERC20(token0).balanceOf(address(this));
        uint balance1 = IERC20(token1).balanceOf(address(this));
        uint liquidity = balanceOf(address(this));
        
        amount0 = (liquidity * balance0) / totalSupply();
        amount1 = (liquidity * balance1) / totalSupply();
        require(amount0 > 0 && amount1 > 0, 'UniswapV2: INSUFFICIENT_LIQUIDITY_BURNED');
        
        _burn(address(this), liquidity);
        IERC20(token0).transfer(to, amount0);
        IERC20(token1).transfer(to, amount1);
        
        balance0 = IERC20(token0).balanceOf(address(this));
        balance1 = IERC20(token1).balanceOf(address(this));
        _update(balance0, balance1);
        kLast = uint(reserve0) * uint(reserve1);
        
        emit Burn(msg.sender, amount0, amount1, to);
    }
    
    /**
     * @dev 代币交换功能
     */
    function swap(
        uint256 amount0Out, 
        uint256 amount1Out, 
        address to,
        bytes calldata data
    ) external override nonReentrant {
        require(amount0Out > 0 || amount1Out > 0, 'UniswapV2: INSUFFICIENT_OUTPUT_AMOUNT');
        
        // 获取储备量
        (uint256 _reserve0, uint256 _reserve1, ) = getReserves();
        require(amount0Out < _reserve0 && amount1Out < _reserve1, 'UniswapV2: INSUFFICIENT_LIQUIDITY');
        
        uint256 balance0;
        uint256 balance1;
        { // 使用代码块来限制变量作用域
            address _token0 = token0;
            address _token1 = token1;
            require(to != _token0 && to != _token1, 'UniswapV2: INVALID_TO');
            
            // 转移代币给接收者
            if (amount0Out > 0) IERC20(_token0).transfer(to, amount0Out);
            if (amount1Out > 0) IERC20(_token1).transfer(to, amount1Out);
            
            // 如果有回调数据，执行回调
            if (data.length > 0) {
                IUniswapV2Callee(to).uniswapV2Call(msg.sender, amount0Out, amount1Out, data);
            }
            
            balance0 = IERC20(_token0).balanceOf(address(this));
            balance1 = IERC20(_token1).balanceOf(address(this));
        }
        
        // 计算输入金额
        uint256 amount0In = balance0 > _reserve0 - amount0Out ? balance0 - (_reserve0 - amount0Out) : 0;
        uint256 amount1In = balance1 > _reserve1 - amount1Out ? balance1 - (_reserve1 - amount1Out) : 0;
        require(amount0In > 0 || amount1In > 0, 'UniswapV2: INSUFFICIENT_INPUT_AMOUNT');
        
        { // 使用代码块来限制变量作用域
            // 验证K值
            uint256 balance0Adjusted = (balance0 * 1000) - (amount0In * 3);
            uint256 balance1Adjusted = (balance1 * 1000) - (amount1In * 3);
            require(
                balance0Adjusted * balance1Adjusted >= _reserve0 * _reserve1 * 1000000,
                'UniswapV2: K'
            );
        }
        
        _update(balance0, balance1);
        emit Swap(msg.sender, amount0In, amount1In, amount0Out, amount1Out, to);
    }
    
    /**
     * @dev 闪电贷功能
     * @param recipient 接收闪电贷的地址
     * @param amount0 借出的token0数量
     * @param amount1 借出的token1数量
     * @param data 回调数据，用于执行闪电贷逻辑
     * @notice 闪电贷必须在同一交易中完成借贷和还款
     */
    function flash(address recipient, uint256 amount0, uint256 amount1, bytes calldata data) external lock nonReentrant {
        uint256 balance0 = IERC20(token0).balanceOf(address(this));
        uint256 balance1 = IERC20(token1).balanceOf(address(this));
        
        // 转移代币给接收者
        if (amount0 > 0) IERC20(token0).transfer(recipient, amount0);
        if (amount1 > 0) IERC20(token1).transfer(recipient, amount1);
        
        // 调用接收者的回调函数，执行闪电贷逻辑
        IUniswapV2Callee(recipient).uniswapV2Call(msg.sender, amount0, amount1, data);
        
        // 验证闪电贷是否已经偿还
        uint256 balance0After = IERC20(token0).balanceOf(address(this));
        uint256 balance1After = IERC20(token1).balanceOf(address(this));
        require(balance0After >= balance0, 'UniswapV2: INSUFFICIENT_FLASH_PAYMENT_0');
        require(balance1After >= balance1, 'UniswapV2: INSUFFICIENT_FLASH_PAYMENT_1');
        
        _update(balance0After, balance1After);
    }
    
    /**
     * @dev 移除超额代币
     * @param to 接收超额代币的地址
     * @notice 当合约中的代币余额超过储备量时，可以提取超额部分
     */
    function skim(address to) external lock {
        address _token0 = token0;
        address _token1 = token1;
        IERC20(_token0).transfer(to, IERC20(_token0).balanceOf(address(this)) - reserve0);
        IERC20(_token1).transfer(to, IERC20(_token1).balanceOf(address(this)) - reserve1);
    }
    
    /**
     * @dev 强制使储备量等于当前余额
     * @notice 用于修正储备量与实际余额不一致的情况
     */
    function sync() external lock {
        _update(
            IERC20(token0).balanceOf(address(this)),
            IERC20(token1).balanceOf(address(this))
        );
    }
    
    /**
     * @dev 内部函数：更新储备量和价格累加器
     * @param balance0 token0的新储备量
     * @param balance1 token1的新储备量
     */
    function _update(uint256 balance0, uint256 balance1) private {
        require(balance0 <= type(uint112).max && balance1 <= type(uint112).max, 'UniswapV2: OVERFLOW');
        
        // 更新价格累加器
        uint32 timeElapsed = uint32(block.timestamp) - blockTimestampLast;
        if (timeElapsed > 0 && reserve0 != 0 && reserve1 != 0) {
            price0CumulativeLast += (reserve1 * 1e18 / reserve0) * timeElapsed;
            price1CumulativeLast += (reserve0 * 1e18 / reserve1) * timeElapsed;
        }
        
        reserve0 = uint112(balance0);
        reserve1 = uint112(balance1);
        blockTimestampLast = uint32(block.timestamp);
        
        emit Sync(reserve0, reserve1);
    }
}

/**
 * @title IUniswapV2Callee
 * @dev 闪电贷回调接口，借用方必须实现此接口
 */
interface IUniswapV2Callee {
    /**
     * @dev 闪电贷回调函数
     * @param sender 发起闪电贷的地址
     * @param amount0 借出的token0数量
     * @param amount1 借出的token1数量
     * @param data 附加数据
     */
    function uniswapV2Call(address sender, uint256 amount0, uint256 amount1, bytes calldata data) external;
}

contracts/core/MyUniswapV2Router.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "../interfaces/IMyUniswapV2Factory.sol";
import "../interfaces/IMyUniswapV2Pair.sol";
import "../interfaces/IWETH.sol";
import "../libraries/MyUniswapV2Library.sol";

/**
 * @title MyUniswapV2Router
 * @dev 实现Uniswap V2的路由功能，处理用户交互和多跳交易
 * 路由合约是用户与协议交互的主要入口，提供了添加/移除流动性和代币交换的便捷接口
 */
contract MyUniswapV2Router {
    // 工厂合约地址，用于创建和查找交易对
    address public immutable factory;
    // WETH合约地址，用于ETH和WETH之间的转换
    address public immutable WETH;
    
    /**
     * @dev 检查交易是否过期的修饰器
     * @param deadline 交易截止时间戳
     */
    modifier ensure(uint deadline) {
        require(deadline >= block.timestamp, 'MyUniswapV2Router: EXPIRED');
        _;
    }
    
    constructor(address _factory, address _WETH) {
        factory = _factory;
        WETH = _WETH;
    }

    // 接收ETH
    receive() external payable {
        assert(msg.sender == WETH);
    }
    
    /**
     * @dev 添加流动性
     */
    function addLiquidity(
        address tokenA,
        address tokenB,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) external ensure(deadline) returns (uint amountA, uint amountB, uint liquidity) {
        // 创建交易对（如果不存在）
        address pair = IMyUniswapV2Factory(factory).getPair(tokenA, tokenB);
        if (pair == address(0)) {
            pair = IMyUniswapV2Factory(factory).createPair(tokenA, tokenB);
        }
        
        // 计算最优添加比例
        (amountA, amountB) = _calculateLiquidity(
            tokenA, tokenB,
            amountADesired, amountBDesired,
            amountAMin, amountBMin
        );
        
        // 转移代币到交易对
        IERC20(tokenA).transferFrom(msg.sender, pair, amountA);
        IERC20(tokenB).transferFrom(msg.sender, pair, amountB);
        
        // 铸造LP代币
        liquidity = IMyUniswapV2Pair(pair).mint(to);
    }

    /**
     * @dev 添加ETH流动性
     */
    function addLiquidityETH(
        address token,
        uint amountTokenDesired,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external payable ensure(deadline) returns (uint amountToken, uint amountETH, uint liquidity) {
        // 创建交易对（如果不存在）
        address pair = IMyUniswapV2Factory(factory).getPair(token, WETH);
        if (pair == address(0)) {
            pair = IMyUniswapV2Factory(factory).createPair(token, WETH);
        }
        
        // 计算最优添加比例
        (amountToken, amountETH) = _calculateLiquidity(
            token,
            WETH,
            amountTokenDesired,
            msg.value,
            amountTokenMin,
            amountETHMin
        );
        
        // 转移代币到交易对
        IERC20(token).transferFrom(msg.sender, pair, amountToken);
        IWETH(WETH).deposit{value: amountETH}();
        IWETH(WETH).transfer(pair, amountETH);
        
        // 铸造LP代币
        liquidity = IMyUniswapV2Pair(pair).mint(to);
        
        // 如果有多余的ETH，退还
        if (msg.value > amountETH) {
            payable(msg.sender).transfer(msg.value - amountETH);
        }
    }
    
    /**
     * @dev 移除流动性
     */
    function removeLiquidity(
        address tokenA,
        address tokenB,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) public ensure(deadline) returns (uint amountA, uint amountB) {
        address pair = IMyUniswapV2Factory(factory).getPair(tokenA, tokenB);
        
        // 将LP代币转移到交易对合约
        IERC20(pair).transferFrom(msg.sender, pair, liquidity);
        
        // 销毁LP代币并获取代币
        (amountA, amountB) = IMyUniswapV2Pair(pair).burn(to);
        
        require(amountA >= amountAMin, 'MyUniswapV2Router: INSUFFICIENT_A_AMOUNT');
        require(amountB >= amountBMin, 'MyUniswapV2Router: INSUFFICIENT_B_AMOUNT');
    }

    /**
     * @dev 移除ETH流动性
     */
    function removeLiquidityETH(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) public ensure(deadline) returns (uint amountToken, uint amountETH) {
        (amountToken, amountETH) = removeLiquidity(
            token,
            WETH,
            liquidity,
            amountTokenMin,
            amountETHMin,
            address(this),
            deadline
        );
        IERC20(token).transfer(to, amountToken);
        IWETH(WETH).withdraw(amountETH);
        payable(to).transfer(amountETH);
    }
    
    /**
     * @dev 代币交换：确切输入金额，最小输出金额
     */
    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external ensure(deadline) returns (uint[] memory amounts) {
        amounts = MyUniswapV2Library.getAmountsOut(factory, amountIn, path);
        require(amounts[amounts.length - 1] >= amountOutMin, 'MyUniswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT');
        
        IERC20(path[0]).transferFrom(
            msg.sender,
            MyUniswapV2Library.pairFor(factory, path[0], path[1]),
            amounts[0]
        );
        
        _swap(amounts, path, to);
    }

    /**
     * @dev ETH换确切数量的代币
     */
    function swapETHForExactTokens(
        uint amountOut,
        address[] calldata path,
        address to,
        uint deadline
    ) external payable ensure(deadline) returns (uint[] memory amounts) {
        require(path[0] == WETH, 'MyUniswapV2Router: INVALID_PATH');
        amounts = MyUniswapV2Library.getAmountsIn(factory, amountOut, path);
        require(amounts[0] <= msg.value, 'MyUniswapV2Router: EXCESSIVE_INPUT_AMOUNT');
        
        IWETH(WETH).deposit{value: amounts[0]}();
        IWETH(WETH).transfer(MyUniswapV2Library.pairFor(factory, path[0], path[1]), amounts[0]);
        _swap(amounts, path, to);
        
        // 退还多余的ETH
        if (msg.value > amounts[0]) {
            payable(msg.sender).transfer(msg.value - amounts[0]);
        }
    }
    
    /**
     * @dev 内部函数：执行代币交换
     */
    function _swap(uint[] memory amounts, address[] memory path, address _to) internal {
        for (uint i; i < path.length - 1; i++) {
            (address input, address output) = (path[i], path[i + 1]);
            (address token0,) = MyUniswapV2Library.sortTokens(input, output);
            uint amountOut = amounts[i + 1];
            
            (uint amount0Out, uint amount1Out) = input == token0 
                ? (uint(0), amountOut) 
                : (amountOut, uint(0));
                
            address to = i < path.length - 2 
                ? MyUniswapV2Library.pairFor(factory, output, path[i + 2]) 
                : _to;
                
            IMyUniswapV2Pair(MyUniswapV2Library.pairFor(factory, input, output))
                .swap(amount0Out, amount1Out, to, new bytes(0));
        }
    }
    
    /**
     * @dev 内部函数：计算最优添加流动性比例
     */
    function _calculateLiquidity(
        address tokenA,
        address tokenB,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin
    ) internal view returns (uint amountA, uint amountB) {
        (uint reserveA, uint reserveB) = MyUniswapV2Library.getReserves(factory, tokenA, tokenB);
        
        if (reserveA == 0 && reserveB == 0) {
            (amountA, amountB) = (amountADesired, amountBDesired);
        } else {
            uint amountBOptimal = MyUniswapV2Library.quote(amountADesired, reserveA, reserveB);
            if (amountBOptimal <= amountBDesired) {
                require(amountBOptimal >= amountBMin, 'MyUniswapV2Router: INSUFFICIENT_B_AMOUNT');
                (amountA, amountB) = (amountADesired, amountBOptimal);
            } else {
                uint amountAOptimal = MyUniswapV2Library.quote(amountBDesired, reserveB, reserveA);
                require(amountAOptimal <= amountADesired, 'MyUniswapV2Router: EXCESSIVE_INPUT_AMOUNT');
                require(amountAOptimal >= amountAMin, 'MyUniswapV2Router: INSUFFICIENT_A_AMOUNT');
                (amountA, amountB) = (amountAOptimal, amountBDesired);
            }
        }
    }
}

